script: |
  super -f text -I q4932.spq | sort > q4932.out

inputs:
  - name: q4932.spq
    data: |
      SELECT ALL + ( + + COUNT ( * ) ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab1
  - name: tab2

outputs:
  - name: q4932.out
    data: |
      9
